todayBetween._queryString:
{[departing;arriving]
  today: distinct select sym,depAirport,depTime,arivAirport,arivTime,flightNumber, aircraftType, registration from flights where arivTime > "d"$.z.p;

  select from today where depAirport in (arriving;departing), arivAirport in (departing;arriving)

 }

weekBetween._queryString:
{[arriv;dep]
  h: hopen `:localhost:HDBPORT:admin:admin; 
  historical:(enlist `date) _ h"select from flights where date > .z.d - 8";
  
  today: distinct select sym,depAirport, depTime,arivAirport, arivTime,flightNumber, aircraftType, registration from (historical,flights);

  select from today where depAirport in (dep;arriv), arivAirport in (dep;arriv)
 }

weekBetween._updateQueryString:
{[dgAdd;dgUpd;dgDel]
  / this sample requires keyed table
  / always use unique key (id), 'Force Reset': checked

  /testTable:: `id xkey ([] id:`int$();name:`symbol$();note1:`symbol$());
  /`testTable upsert(0i;`dummy;`);
  /testTable

    availablePK: 1 + exec max id from testTable;

    $[((count dgUpd)>0);`testTable upsert flip dgUpd;];
    $[((count dgDel)>0);delete from `testTable where id in (dgDel[`id]);];

    /generate unique ids for new items
    addedCount: count dgAdd[`id];
    dgAdd[`id]:(availablePK + til addedCount);
    $[((count dgAdd)>0);`testTable upsert flip dgAdd;];
}

