flightsPer._queryString:
{[arriv;dep]

  h: hopen `:localhost:HDBPORT:admin:admin; 
  historical:(enlist `date) _ h"select from flights";
  
  theLot: distinct select sym,depAirport, depTime,arivAirport, arivTime,flightNumber, aircraftType, registration from (historical,flights) where arivAirport in (arriv;dep), depAirport in (arriv;dep);  

  flightsToday: count select from theLot where arivTime > .z.d;
  flightsThisWeek: count select from theLot where arivTime > .z.d - 8;
  flightsThisMonth: count select from theLot where arivTime > "d"$`month$.z.d;

  ([]
    property: ("Total Flights";"Today";"WTD";"MTD";"Flights per day (This week)");
    propertyValue:("";flightsToday;flightsThisWeek;flightsThisMonth;(.Q.fmt[6;2]flightsThisWeek%7)) 
    )
 }
